// src/components/SignupDoctor.js

import React, { useState } from 'react';
import axios from 'axios';

function SignupDoctor() {
  const [fullName, setFullName] = useState("");
  const [email, setEmail] = useState("");
  const [medicalLicenseNumber, setMedicalLicenseNumber] = useState("");
  const [specialization, setSpecialization] = useState("");
  const [yearsOfExperience, setYearsOfExperience] = useState("");
  const [phoneNumber, setPhoneNumber] = useState("");
  const [password, setPassword] = useState("");
  const [error, setError] = useState("");

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post("http://localhost:8070/api/auth/register", {
        fullName,
        email,
        medicalLicenseNumber,
        specialization,
        yearsOfExperience,
        phoneNumber,
        password,
      });
      console.log(response.data); // Handle success
    } catch (error) {
      setError("Error registering user");
      console.error(error);
    }
  };
  const handleSignupDoctor = async (e) => {
    e.preventDefault();
    setError(""); // Clear any previous errors
  
    console.log({
      name,         // Doctor's name
      email,        // Doctor's email
      password,     // Password
      role,         // Doctor role
      specialization, // Doctor's specialization (if applicable)
    }); // Log request data for debugging
  
    try {
      const response = await axios.post("http://localhost:8070/api/auth/signup-doctor", {
        name,
        email,
        password,
        role,
        specialization, // If your form includes this
      });
  
      if (response.data.success) {
        navigate("/doctor-home"); // Redirect to the doctor's home page
      } else {
        setError("Registration failed. Please try again.");
      }
    } catch (error) {
      if (error.response) {
        console.error('Server Error:', error.response.data); // Log the error details from the server
        setError("Error during registration: " + (error.response.data.message || "Unknown error"));
      } else if (error.request) {
        console.error('No Response:', error.request);
        setError("No response from server. Please try again.");
      } else {
        console.error('Error:', error.message);
        setError("Error during registration. Please try again.");
      }
    }
  };
  

  return (
    <form onSubmit={handleSubmit}>
      <input
        type="text"
        placeholder="Full Name"
        value={fullName}
        onChange={(e) => setFullName(e.target.value)}
        required
      />
      <input
        type="email"
        placeholder="Email"
        value={email}
        onChange={(e) => setEmail(e.target.value)}
        required
      />
      <input
        type="text"
        placeholder="Medical License Number"
        value={medicalLicenseNumber}
        onChange={(e) => setMedicalLicenseNumber(e.target.value)}
        required
      />
      <input
        type="text"
        placeholder="Specialization"
        value={specialization}
        onChange={(e) => setSpecialization(e.target.value)}
        required
      />
      <input
        type="number"
        placeholder="Years of Experience"
        value={yearsOfExperience}
        onChange={(e) => setYearsOfExperience(e.target.value)}
        required
      />
      <input
        type="text"
        placeholder="Phone Number"
        value={phoneNumber}
        onChange={(e) => setPhoneNumber(e.target.value)}
        required
      />
      <input
        type="password"
        placeholder="Password"
        value={password}
        onChange={(e) => setPassword(e.target.value)}
        required
      />
      <button type="submit">Register</button>
      {error && <p className="error">{error}</p>}
    </form>
  );
}

export default SignupDoctor;
